description:
Cachao: Uno Mas

Arts Documentary hosted by Andy Garcia, published by PBS broadcasted as part of PBS American Masters series in 2010 - English narration


Information
------------------------------

The Grammy-winning bassist Israel &quot;Cachao&quot; Lopez died in Coral Gables, Florida in March 2008, almost 90-years old. A maestro of legendary status and ultimately considered one of the greatest Afro-Cuban musicians of all time, he had made his home in the United States for the past four decades. American Masters pays tribute to the Father of Mambo in the series' bilingual film, Cachao: Uno Mas. The film is produced, narrated and illuminated by the actor Andy Garcia, a close friend and ardent fan, who helped re-establish Cachao's career in the '90s.

A production of DOC Film Institute in association with THIRTEEN for American Masters and Latino Public Broadcasting for PBS

